import React from 'react';
import SQLHeroLogo from '../../assets/images/database.svg';
import Home from '../../assets/images/home.svg';
import Challenges from '../../assets/images/challenges.svg';
import Community from '../../assets/images/community.svg';
import Settings from '../../assets/images/settings.svg';

function MainNav() {
    return (
        <nav className='h-full'>
            <ul className='flex flex-col w-20 items-center border-r py-10 gap-10'>
                <li>
                    <a href=''><img src={SQLHeroLogo} alt='SQL Hero Logo' className='w-12' /></a>
                </li>
                <li>
                    <a href=''><img src={Home} alt='Home' className='w-10' /></a>
                </li>
            </ul>
        </nav>
    );  
}

export default MainNav;
